{ m_x3 = arg_x3; m_y3 = arg_y3; // check & correct the triangle points to counterclockwise order _check_points();
}
void Triangle::set_x1(const double &arg_x1)
{ m_x1 = arg_x1; // check & correct the triangle points to counterclockwise order _check_points();
}
void Triangle::set_y1(const double &arg_y1)
{ m_y1 = arg_y1; // check & correct the triangle points to counterclockwise order _check_points();
}
void Triangle::set_x2(const double &arg_x2)
