nus_pressed = !minus_pressed; break; case '%': type_num = type_num * 0.01; break; default: break; } } else if (typeid(arg_btn) == typeid(Func_button)) { switch (arg_btn.press()) { case 'c': type_num = 0; status = 0; curr_op = '='; next_op = '='; break; case '=': curr_op = '='; next_op = '='; break; } } break; } } double update_result(const double &arg_result) { switch (status) { case 0: return arg_result; case 1: return arg_result; case 2: switch (curr_op) { case '+': return arg_result + type_num; case '-': return arg_result - type_num; case '*': return arg_result * type_num; case '/': return arg_result / type_num; case '=': return type_num; default: return arg_result; } } return arg_result; }
