eal *)arg_comp_calc.m_input_val_ptr); break; case 'C': m_curr_val_ptr = new Complex(*(Complex *)arg_comp_calc.m_curr_val_ptr); m_input_val_ptr = new Complex(*(Complex *)arg_comp_calc.m_input_val_ptr); break; case 'I': m_curr_val_ptr = new Integer(*(Integer *)arg_comp_calc.m_curr_val_ptr); m_input_val_ptr = new Integer(*(Integer *)arg_comp_calc.m_input_val_ptr); break; default: cout << "Error: Invalid value type" << endl; break; } } // Destructor ~Number_Calc() { delete m_curr_val_ptr; delete m_input_val_ptr; } // cin `>>` operator for set input value or operation friend istream &operator>>(istream &arg_is, Number_Calc &arg_comp_calc) { string temp_string; getline(arg_is, temp_string); if (temp_string == "+") { arg_comp_calc._add(); } else if (temp_string == "-") { arg_comp_calc._sub(); } else if (temp_string == "*") { arg_comp_calc._mul(); } else if (temp_string == "/") { arg_comp_calc._div(); } else if (temp_string == "=") { arg_comp_calc._assign(); } else { arg_comp_calc.m_input_val_ptr->set_value(temp_string); arg_comp_calc.m_op_input = true; arg_comp_calc._calc_result(); } return arg_is; } // cout `<<` operator for print calculator status // note: be careful about the format of output // cout `<<` operator for print calculator status friend ostream &operator<<(ostream &arg_os, const Number_Calc &arg_comp_calc) { arg_os << arg_comp_calc.m_curr_val_ptr->get_string(); return arg_os; }
}; int main()
{ // create an instance of the class for Integer Number_Calc calc_i('I'); for (int i = 0; i < 3; i++) { cin >> calc_i; cout << calc_i << endl; } // create an instance of the class for Real Number_Calc calc_r('R'); for (int i = 0; i < 3; i++) { cin >> calc_r; cout << calc_r << endl; } // create an instance of the class for Complex Number_Calc calc_c('C'); for (int i = 0; i < 3; i++) { cin >> calc_c; cout << calc_c << endl; }
