Ref: Basic Input / Output in C++ C++ comes with libraries that provide for performing input and output. Input Stream: The information is from the device (for example, Keyboard) to the main memory Output Stream: The information is from main memory to device (display screen) bg right fit What is a buffer? Ref: Clearing The Input Buffer In C/C++ A temporary storage area is called a buffer. All standard input and output devices contain an input and output buffer. In standard C/C++, streams are buffered, for example in the case of standard input, when we press the key on the keyboard, it isn’t sent to your program, rather it is buffered by the operating system till the time is allotted to that program. Example: // C++ Code to explain why
// not clearing the input
// buffer causes undesired
// outputs
#include <iostream>
#include <vector>
using namespace std; int main()
{ int a; char ch[80]; // Enter input from user // - 4 for example cin >> a; // Get input from user - // "GeeksforGeeks" for example cin.getline(ch, 80); // Prints 4 cout << a << endl; // Printing string : This does // not print string cout << ch << endl; return 0;
} Console: $ ./a.out
4
GeeksforGeeks
4 $ Why? because the '\n' character is typed into the buffer and is not removed. When the user presses the Enter key, the '\n' character sends to the buffer. How to clear the buffer? Using cin.ignore(numeric_limits::max(),’\n’); // C++ Code to explain how
// "cin.ignore(numeric_limits
// <streamsize>::max(),'\n');"
