Ref: std::basic_ios , std::ios_base::iostate 4 states: .good(), .eof(), .fail(), .bad() .good(): checks if no error has occurred i.e. I/O operations are available. .eof(): checks if end-of-file has been reached. .fail(): checks if an error has occurred. .bad(): checks if a non-recoverable error has occurred. all of them are based on ios_base::iostate badbit: true if the stream has an irrecoverable stream error eofbit: true if the stream's associated input sequence has reached end-of-file failbit: true if the stream has an input/output operation failed (formatting or extraction error) Example Ref: std::basic_ios<CharT,Traits>::good #include <iostream>
#include <fstream>
#include <cstdlib>
int main()
{ const char *fname = "test.txt"; std::ofstream ofile{fname}; ofile << "10 " << "11 " << "12 " << "non-int"; ofile.close(); std::ifstream file{fname}; if (!file.good()) { std::cout << "#1. Opening file test.txt failed - " "one of the error flags is true\n"; return EXIT_FAILURE; } // typical C++ I/O loop uses the return value of the I/O function // as the loop controlling condition, operator bool() is used here for (int n; file >> n;) { std::cout << n << ' '; } std::cout << '\n'; if (file.bad()) { std::cout << "#2. I/O error while reading - badbit is true\n"; return EXIT_FAILURE; } else if (file.eof()) { std::cout << "#3. End of file reached successfully - eofbit is true\n" "This is fine even though file.good() is false\n"; } else if (file.fail()) { std::cout << "#4. Non-integer data encountered - failbit is true\n"; }
} Output: $ ./a.out
10 11 12
#4. Non-integer data encountered - failbit is true
