class Vector_3D
{
private: // define the three factor of the basis vectors // on the x, y, z axes double m_x, m_y, m_z; public: // Constructor Vector_3D(const double &arg_x = 0.0, const double &arg_y = 0.0, const double &arg_z = 0.0); Vector_3D(const Point_3D &arg_point1, const Point_3D &arg_point2); // Copy constructor Vector_3D(const Vector_3D &arg_vector); // Destructor ~Vector_3D() { // do nothing } // set the three factor of the basis vectors void set_vector(const double &arg_x, const double &arg_y, const double &arg_z); void set_vector(const Point_3D &arg_point1, const Point_3D &arg_point2); void set_x(const double &arg_x); void set_y(const double &arg_y); void set_z(const double &arg_z); // get the three factor of the basis vectors double get_x() const; double get_y() const; double get_z() const; // assign operator Vector_3D &operator=(const Vector_3D &arg_vector); // calculate the length of the Vector_3D double length(); // calculate the dot product of two vectors int dot(const Vector_3D &); // calculate the cross product of two vectors Vector_3D cross(const Vector_3D &); // write the Vector_3D in binary format void write_binary(std::ofstream &arg_ofs); // read the Vector_3D in binary format void read_binary(std::ifstream &arg_ifs); // print the Vector_3D in format (x, y, z) // accessable to const object friend std::ostream &operator<<(std::ostream &arg_os, const Vector_3D &arg_point); // read the factors of a vector from the input, // format: (x, y, z) and ignore space friend std::istream &operator>>(std::istream &arg_is, Vector_3D &arg_point);
