int Vector_3D::dot(const Vector_3D &arg_v)
{ // calculate the dot product of two vectors return m_x * arg_v.m_x + m_y * arg_v.m_y + m_z * arg_v.m_z;
} // calculate the cross product of two vectors
Vector_3D Vector_3D::cross(const Vector_3D &arg_v)
{ // calculate the cross product of two vectors Vector_3D v; v.m_x = m_y * arg_v.m_z - m_z * arg_v.m_y; v.m_y = m_z * arg_v.m_x - m_x * arg_v.m_z; v.m_z = m_x * arg_v.m_y - m_y * arg_v.m_x; return v;
