There are three types of exceptions: any preliminary types (e.g., int, char, float, etc.) Discussed in the previous section user-defined types (e.g., class, struct, etc.) Discussed in the previous section std::exception std::exception Ref: Exception header in C++ with examples std::exception is the base class of all exceptions in C++ standard library. Exception Description std::bad_alloc Memory allocation failed std::bad_cast Invalid type conversion std::bad_exception Exception handling failed std::bad_typeid Invalid typeid std::bad_function_call Invalid function call std::bad_weak_ptr Invalid weak pointer std::logic_error Logic error std::runtime_error Runtime error exception::what() Ref: exception::what() in C++ with Examples To get the description of the exception, use the what() member function. The example below shows how to use the what() member function and how it works. // C++ code for exception::what()
#include <iostream>
#include <exception>
using namespace std;
class geeksforgeeks : public exception
{
public: const char *what() const noexcept { return "Hey!!"; }
}; // main method
int main()
{ // try block try { throw geeksforgeeks(); } // catch block to handle the errors catch (exception &gfg) { cout << gfg.what(); } return 0;
} Example: std::bad_alloc // C++ program to illustrate bad_alloc
// using class bad_alloc
#include <exception>
#include <iostream>
using namespace std;
// Function to illustrate bad_alloc
void createArray(long long N)
{ // Try Block try { // Create an array of length N int *array = new int[N]; // If created successfully then // print the message cout << "Array created successfully" << " of length " << N << " \n"; } // Check if the memory // was allocated or not // using class bad_alloc catch (bad_alloc &e) { // If not, print the error message cout << e.what() << " for array of length " << N << " \n"; }
} // Driver Code
int main()
{ // Function call to create an // array of 1000 size createArray(1000); // Function call to create an // array of 1000000000 size createArray(10000000000); return 0;
} Example: std::logic_error // C++ program to illustrate logic_error
#include <exception>
#include <iostream>
using namespace std;
// Function to find factorial of N and
// throws error if occurs
void findFactorial(int N)
{ // Initialise variable by 1 int factorial = 1; // Check for errors try { // If N is less than zero then, // it shows errors as factorial // of negative number can't be // calculated if (N < 0) { // Exception object which // returns the message passed // to it throw invalid_argument( "negative not allowed"); } // Find factorial if no error occurs for (int i = N; i > 0; i--) { factorial *= i; } cout << "Factorial of " << N << " is " << factorial << endl; } // Print the error message catch (exception &e) { cout << e.what(); }
} // Driver Code
